import { types } from "../types/exampleType";

//example of reducer
const exampleReducer = (state = {attribute:''}, action) => {
    let returnL = {
        attribute: state.attribute
    }
    switch(action.type){
        case types.EXAMPLE:{
            returnL.attribute = "example"
            break;
        }
        case types.EXAMPLE2:{
            returnL.attribute = "example2"
            break;
        }
        default:
            returnL.attribute = ""
        
    }
    return returnL;
}

export default exampleReducer;
